import type { FlightLegData } from '../../interfaces/legs/flight-leg.interface';
import type { TrimmedFlightLeg } from '../../interfaces/legs/trimmed-flight-leg.interface';

export const trimFlightLeg = (request: FlightLegData): TrimmedFlightLeg => {
  const { id, createdTime, fields } = request;

  const { Status, Airline, Passengers } = fields;

  const trimmedLeg: TrimmedFlightLeg = {
    id: id,
    createdTime: createdTime,
    Status: Status,
    Airline: Airline,
    'Departure Date/Time': fields['Departure Date/Time'],
    'Arrival Date/Time': fields['Arrival Date/Time'],
    'Nautical Miles': fields['Nautical Miles'],
    Passengers: Passengers,
    'Departure Airport': fields['Departure Airport'],
    'Arrival Airport': fields['Arrival Airport'],
    'Leg ID': fields['Leg ID'],
    'Leg Type': fields['Leg Type'],
    'Total Miles': fields['Total Miles'],
    'Passenger Names': fields['Passenger Names'],
    'Total Cost': fields['Total Cost'],
    'AirTable Record ID': fields['AirTable Record ID'],
    'Request AirTable Record ID': fields['Request AirTable Record ID'],
    'Passenger AirTable Record IDs': fields['Passenger AirTable Record IDs'],
    'Log Airline Credit': {
      label: fields['Log Airline Credit'].label,
      url: fields['Log Airline Credit'].url,
    },
    'Patient Name': fields['Patient Name'],
    'Patient Latest Trip': fields['Patient Latest Trip'],
    'Is Latest Trip': fields['Is Latest Trip'],
  };

  return trimmedLeg;
};

import type { PassengerData } from '../../interfaces/passenger/passenger.interface';
import type { TrimmedPassenger } from '../../interfaces/passenger/trimmed-passenger.interface';

export const trimPassenger = (passenger: PassengerData): TrimmedPassenger => {
  const { id, createdTime, fields } = passenger;

  const { Type, Gender, Street, Country, Email, Ethnicity, Diagnosis, Age } =
    fields;

  const trimmedPassenger: TrimmedPassenger = {
    id: id,
    createdTime: createdTime,
    Type: Type,
    'First Name': fields['First Name'],
    'Last Name': fields['Last Name'],
    'Date of Birth': fields['Date of Birth'],
    Gender: Gender,
    Street: Street,
    Country: Country,
    Email: Email,
    'Household Income': fields['Household Income'],
    'Household Size': fields['Household Size'],
    Ethnicity: Ethnicity,
    'Military Service': fields['Military Service'],
    'Military Member': fields['Military Member'],
    'How did you hear about us': fields['How did you hear about us'],
    'All Flight Legs': fields['All Flight Legs'],
    Diagnosis: Diagnosis,
    'AirTable Record ID': fields['AirTable Record ID'],
    '# of Flight Legs': fields['# of Flight Legs'],
    '# of Booked Flight Requests': fields['# of Booked Flight Requests'],
    'Birth Month': fields['Birth Month'],
    'Full Name': fields['Full Name'],
    Age: Age,
    'Latest Trip': fields['Latest Trip'],
  };

  return trimmedPassenger;
};

import { AIRLINES } from './constants';
import { faker } from '@faker-js/faker';
import type { FlightRequestData } from '../interfaces/requests/flight-request.interface';
import type { PassengerData } from '../interfaces/passenger/passenger.interface';
import type { FlightLegData } from '../interfaces/legs/flight-leg.interface';

/**
 * Creates a test passenger data object with random data
 *
 * @param manualData - Optional data to override the random data
 * @returns A test passenger data object
 */
export const createTestPassengerData = (
  manualData: Partial<PassengerData> = {}
): PassengerData => {
  const firstName = faker.person.firstName();
  const lastName = faker.person.lastName();
  const birthday = faker.date.past().toISOString();
  const getPreviousDay = (isoDate: string) =>
    new Date(new Date(isoDate).getTime() - 24 * 60 * 60 * 1000)
      .toISOString()
      .split('T')[0];

  return {
    id: faker.string.uuid(),
    createdTime: faker.date.recent().toISOString(),
    fields: {
      Type: faker.helpers.arrayElement([
        'Patient',
        'Accompanying Passenger',
        'Partner Organization',
      ]),
      'First Name': firstName,
      'Last Name': lastName,
      'Date of Birth': birthday,
      Gender: faker.helpers.arrayElement(['Female', 'Male']),
      Street: faker.location.streetAddress(),
      Country: faker.location.country(),
      Email: faker.internet.email({
        firstName: firstName,
        lastName: lastName,
      }),
      'Household Income': faker.number.int({
        min: 5000,
        max: 400000,
      }),
      'Household Size': faker.number.int({
        min: 1,
        max: 8,
      }),
      Ethnicity: faker.helpers.arrayElements(
        [
          'American Indian or Alaska Native',
          'Asian',
          'Black or African American',
          'Hispanic or Latino',
          'Native Hawaiian or Other Pacific Islander',
          'White',
          'Other',
        ],
        faker.number.int({
          min: 1,
          max: 5,
        })
      ),
      'Military Service': faker.helpers.arrayElement([
        'Active',
        'Veteran',
        'Not Applicable',
      ]),
      'Military Member': faker.helpers.arrayElements(
        ['Self', 'Spouse', 'Mother', 'Father', 'Other'],
        faker.number.int({
          min: 0,
          max: 3,
        })
      ),
      'How did you hear about us': faker.helpers.arrayElements(
        ['Social Media', 'Internet Search', 'Friend or Family', 'Other'],
        faker.number.int({
          min: 1,
          max: 1,
        })
      ),
      'BL - Account Number': faker.finance.accountNumber(),
      'All Flight Legs': faker.helpers.arrayElements(
        [faker.string.uuid(), faker.string.uuid(), faker.string.uuid()],
        faker.number.int({
          min: 1,
          max: 3,
        })
      ),
      Diagnosis: faker.helpers.arrayElements(
        [faker.string.uuid(), faker.string.uuid(), faker.string.uuid()],
        faker.number.int({
          min: 1,
          max: 3,
        })
      ),
      'Treatment Site Totals 2': [],
      'Passenger ID': faker.string.uuid(),
      'AirTable Record ID': faker.string.uuid(),
      '# of Flight Legs': faker.number.int({
        min: 1,
        max: 10,
      }),
      '# of Booked Flight Requests (Patient)': faker.number.int({
        min: 1,
        max: 3,
      }),
      '# of Booked Flight Requests (Pass 2)': faker.number.int({
        min: 1,
        max: 3,
      }),
      '# of Booked Flight Requests (Pass 3)': faker.number.int({
        min: 1,
        max: 3,
      }),
      '# of Booked Flight Requests (Accompanying)': faker.number.int({
        min: 1,
        max: 3,
      }),
      '# of Booked Flight Requests': faker.number.int({
        min: 1,
        max: 10,
      }),
      'Departure Date/Time (from All Flight Legs)': faker.helpers.arrayElements(
        [
          faker.date.recent().toISOString(),
          faker.date.recent().toISOString(),
          faker.date.recent().toISOString(),
        ],
        faker.number.int({
          min: 1,
          max: 3,
        })
      ),
      'Name (from Treatment Site Totals 2)': [],
      'Name (from Treatment Site Totals 2) 2': [],
      'PUR (from All Flight Legs)': faker.helpers.arrayElements<number>(
        [
          faker.number.int({
            min: 1,
            max: 10000,
          }),
          faker.number.int({
            min: 1,
            max: 10000,
          }),
          faker.number.int({
            min: 1,
            max: 10000,
          }),
        ],
        faker.number.int({
          min: 1,
          max: 3,
        })
      ),
      'Birth Month': faker.date.month(),
      'Full Name': `${firstName} ${lastName}`,
      'Passenger Names (from All Flight Legs)': faker.helpers.arrayElements(
        [
          `${faker.person.firstName()} ${faker.person.lastName()}`,
          `${faker.person.firstName()} ${faker.person.lastName()}`,
          `${faker.person.firstName()} ${faker.person.lastName()}`,
        ],
        faker.number.int({
          min: 1,
          max: 3,
        })
      ),
      '# of Accompanying Passengers': faker.number.int({
        min: 1,
        max: 3,
      }),
      Age: faker.number.int({
        min: 1,
        max: 80,
      }),
      Birthday: birthday,
      'Day Before Birthday': getPreviousDay(birthday),
      'BL - Site 1 (from All Flight Legs)': faker.helpers.arrayElements(
        [faker.company.name(), faker.company.name(), faker.company.name()],
        faker.number.int({
          min: 1,
          max: 3,
        })
      ),
      Created: faker.date.recent().toISOString(),
      'Latest Trip': faker.date.recent().toISOString(),
      'TS City, State (from Treatment Site Totals 2)': [],
      ...manualData.fields,
    },
    ...manualData,
  };
};

